import React, { Component } from 'react'

export default class Home extends Component {
    render() {
        return (
            <div style={{marginTop:'370px', marginLeft:'450px'}}>
                <tr>
                <th><img src="/images/channeling.png" width="110" height="110" className="d-inline-block align-top m-5" alt=""/></th>
                <th><img src="/images/patientinfo.png" width="110" height="110" className="d-inline-block align-top m-5" alt=""/></th>           
                <th><img src="/images/payment.png" width="110" height="110" className="d-inline-block align-top m-5" alt=""/></th>
                <th><img src="/images/surgery.png" width="110" height="110" className="d-inline-block align-top m-5" alt=""/></th>
                <th><img src="/images/pharmacy.png" width="110" height="110" className="d-inline-block align-top m-5" alt=""/></th>
                <th><img src="/images/services.png" width="110" height="110" className="d-inline-block align-top m-5" alt=""/></th>
                </tr>

                <tr>
                    
                </tr>
            </div>
        )
    }
}
